import React, { useState, useEffect } from 'react';
import { styled } from '@mui/material/styles';
import {
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  CircularProgress,
  Alert,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Typography,
  Box,
} from '@mui/material';
import { useOptionChainData } from '../../features/optionChain/hooks/useOptionChainData';
import { optionsApi } from '../../services/api/optionsApi';
import { OptionData } from '../../types/options';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  padding: theme.spacing(1),
  textAlign: 'center',
  '&.positive': {
    color: theme.palette.success.main,
    fontWeight: 500,
  },
  '&.negative': {
    color: theme.palette.error.main,
    fontWeight: 500,
  },
  '&.strike': {
    backgroundColor: theme.palette.grey[100],
    fontWeight: 600,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': {
    backgroundColor: theme.palette.action.hover,
  },
  '&:hover': {
    backgroundColor: theme.palette.action.selected,
  },
}));

interface Props {
  symbol: string;
}

export const OptionChainGrid: React.FC<Props> = ({ symbol }) => {
  const [selectedExpiry, setSelectedExpiry] = useState<string>('');
  const [expiryDates, setExpiryDates] = useState<string[]>([]);
  const { data, loading, error } = useOptionChainData(symbol, selectedExpiry);

  // Fetch expiry dates when symbol changes
  useEffect(() => {
    const fetchExpiryDates = async () => {
      try {
        const dates = await optionsApi.getExpiryDates(symbol);
        setExpiryDates(dates);
        if (dates.length > 0) {
          setSelectedExpiry(dates[0]); // Select first expiry by default
        }
      } catch (err) {
        console.error('Failed to fetch expiry dates:', err);
      }
    };

    fetchExpiryDates();
  }, [symbol]);

  const handleExpiryChange = (event: any) => {
    setSelectedExpiry(event.target.value);
  };

  if (loading) {
    return (
      <Box display="flex" justifyContent="center" p={3}>
        <CircularProgress />
      </Box>
    );
  }

  if (error) {
    return (
      <Alert severity="error" sx={{ m: 2 }}>
        Failed to load option chain data: {error.message}
      </Alert>
    );
  }

  if (!data) {
    return (
      <Alert severity="info" sx={{ m: 2 }}>
        Select an expiry date to view option chain
      </Alert>
    );
  }

  return (
    <Box>
      <Box sx={{ p: 2, display: 'flex', alignItems: 'center', gap: 2 }}>
        <FormControl sx={{ minWidth: 200 }}>
          <InputLabel id="expiry-select-label">Expiry Date</InputLabel>
          <Select
            labelId="expiry-select-label"
            id="expiry-select"
            value={selectedExpiry}
            label="Expiry Date"
            onChange={handleExpiryChange}
          >
            {expiryDates.map((date) => (
              <MenuItem key={date} value={date}>
                {date}
              </MenuItem>
            ))}
          </Select>
        </FormControl>
      </Box>

      <TableContainer component={Paper}>
        <Table size="small">
          <TableHead>
            <TableRow>
              <StyledTableCell>Strike</StyledTableCell>
              <StyledTableCell>LTP</StyledTableCell>
              <StyledTableCell>Change</StyledTableCell>
              <StyledTableCell>IV</StyledTableCell>
              <StyledTableCell>Volume</StyledTableCell>
              <StyledTableCell>OI</StyledTableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {data.strikes.map((strike) => (
              <StyledTableRow key={strike}>
                <StyledTableCell className="strike">{strike}</StyledTableCell>
                <StyledTableCell>{data.options[strike]?.lastPrice || '-'}</StyledTableCell>
                <StyledTableCell 
                  className={data.options[strike]?.change > 0 ? 'positive' : 'negative'}
                >
                  {data.options[strike]?.change || '-'}
                </StyledTableCell>
                <StyledTableCell>{data.options[strike]?.iv?.toFixed(2) || '-'}</StyledTableCell>
                <StyledTableCell>{data.options[strike]?.volume || '-'}</StyledTableCell>
                <StyledTableCell>{data.options[strike]?.oi || '-'}</StyledTableCell>
              </StyledTableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};
